import React from 'react'
import {Box,User} from './Hero.Elements'; 

function Hero() {
    return (
        <>
          <Box>
                <User>
                User Login
                </User>
                <Form>
                    <input type="" name="" value="" placeholder="UserName" />
                </Form>
           </Box>
        </>
    )
}
export default Hero;
